INSERT [dbo].[Organization] ([Organization_ID], [Name], [Description], [Image]) VALUES (1, N'Trung tâm Hỗ trợ Học sinh, sinh viên TP. Hồ Chí Minh', N'Là đơn vị hành chính sự nghiệp trực thuộc Thành đoàn Thành phố Hồ Chí Minh được thành lập từ năm 1996 với các chức năng - nhiệm vụ như:', NULL)
INSERT [dbo].[Organization] ([Organization_ID], [Name], [Description], [Image]) VALUES (2, N'Sức Mạnh 2000 - Ánh sáng núi rừng', N'Là một dự án gây quỹ xây trường được khởi xướng và điều hành bởi anh Hoàng Hoa Trung - Forbes 30 Under 30 2020, Gương mặt trẻ Việt Nam Tiêu biểu 2019. Tính tới tháng 2/2021, dự án đã xây dựng thành công gần 130 điểm trường, nhà nội trú, nhà hạnh phúc, cầu dân sinh ở các tỉnh vùng cao, giúp hơn 7000 trẻ em được đến trường. Tìm hiểu về dự án thêm tại: http://sucmanh2000.com', NULL)
INSERT [dbo].[Organization] ([Organization_ID], [Name], [Description], [Image]) VALUES (3, N'Quỹ từ thiện Hoa Chia Sẻ ', N'Quỹ Hoa Chia Sẻ là một tổ chức từ thiện với 6 cơ sở trên toàn quốc, được thành lập với sứ mệnh “Thúc đẩy nền tảng chia sẻ xã hội”. Quỹ xã hội – từ thiện được thành lập hoàn toàn tự nguyện, và Quỹ hoạt động không vì lợi nhuận, trên nguyên tắc tự tạo vốn, hoạt động nhằm mục đích xã hội – từ thiện, trong đó ưu tiên giúp đỡ các gia đình khó khăn, gia đình có công với cách mạng và hỗ trợ, khuyến khích phát triển văn hóa, giáo dục, y tế, thể dục thể thao, khoa học và các mục đích phát triển cộng đồng phù hợp quy định của pháp luật.', NULL)
INSERT [dbo].[Organization] ([Organization_ID], [Name], [Description], [Image]) VALUES (4, N'Quỹ Từ Thiện & BTXH Trăng Khuyết', N'Trăng khuyết là một tổ chức từ thiện về nhân đạo và sự sống, nhằm kết nối cộng đồng và thực hiện các hoạt động trợ giúp trực tiếp cho các cụ già không nơi nương tựa và trẻ em bị bỏ rơi. Thông qua các hoạt động: cứu trợ khẩn cấp, cung cấp bữa ăn, chỗ ở và cải thiện cuộc sống. Trăng Khuyết hoạt động độc lập, phi tôn giáo và phi lợi nhuận trên toàn lãnh thổ Việt Nam. Thông qua pháp nhân là Quỹ Từ Thiện & BTXH Trăng Khuyết, một doanh nghiệp xã hội, hoạt động 100% vì cộng đồng.', NULL)
INSERT [dbo].[Organization] ([Organization_ID], [Name], [Description], [Image]) VALUES (5, N'Live & Learn', N'Dự án được bảo trợ bởi Trung tâm Sống và Học tập vì Môi trường và Cộng đồng (Live & Learn). Live & Learn là tổ chức phi lợi nhuận và phi chính phủ thành lập, và là thành viên của mạng lưới Live & Learn quốc tế. Sứ mệnh của Live & Learn là giáo dục, huy động nguồn lực cộng đồng, và thúc đẩy các quan hệ đối tác để khích lệ hiểu biết sâu rộng hơn về phát triển bền vững, cũng như tiến tới một tương lai bền vững.', NULL)
INSERT [dbo].[Organization] ([Organization_ID], [Name], [Description], [Image]) VALUES (6, N'Ủy ban Mặt trận Tổ Quốc Việt Nam', N'Mặt trận Tổ quốc Việt Nam là hình thức tổ chức của Mặt trận Dân tộc Thống nhất Việt nam với mục tiêu tập hợp và phát huy sức mạnh của khối Đại đoàn kết toàn dân phấn đấu cho một nước Việt Nam độc lập, tự do, hạnh phúc, dân giàu, nước mạnh, xã hội công bằng văn minh. Sau khi cả nước đã được độc lập, sự thống nhất và toàn vẹn của một quốc gia đòi hỏi hợp nhất 3 tổ chức mặt trận. Nhằm đáp ứng yêu cầu của giai đoạn cách mạng mới, Đại hội Mặt trận Dân tộc thống nhất họp từ 31/1 đến 4/2/1977 tại thành phố Hồ Chí Minh đã thống nhất ba tổ chức Mặt trận ở hai miền Nam Bắc nước ta thành một tổ chức Mặt trận Dân tộc thống nhất duy nhất lấy tên là Mặt trận Tổ quốc Việt Nam

Mặt trận Tổ quốc Việt Nam với sự lãnh đạo của Đảng Cộng sản Việt Nam, sự thống nhất ý chí của tất cả các tổ chức của các giai tầng trong xã hội, các cá nhân tiêu biểu của các dân tộc, tôn giáo, tầng lớp, các vị lãnh đạo tiêu biểu cho ý chí đoàn kết của dân tộc, luôn phấn đấu xây dựng khối Đại đoàn kết dân tộc vững mạnh thực hiện lời dạy của Hồ Chí Minh vị lãnh tụ của toàn dân tộc: "Mục đích phấn đấu của Mặt trận Dân tộc thống nhất là xây dựng một nước Việt Nam hoà bình, thống nhất, độc lập, dân chủ và giàu mạnh".', NULL)
