INSERT [dbo].[Campaign] ([Campaign_ID], [Organization_ID], [Name], [Target_budget], [Start_date], [End_date], [Status], [Description], [Image]) VALUES (4, 4, N'Giúp cô con gái nghèo chăm lo mẹ già đãng trí đáng thương', 50000000.0000, CAST(N'2021-12-23' AS Date), NULL, 1, N'Cùng đóng góp để hỗ trợ ăn uống, thuốc thang cho cụ Lưu Anh, vì gia đình quá đỗi nghèo khó, nên con cái cụ cũng không có khả năng chăm sóc, phụ dưỡng cụ đang ở tuổi cao sức yếu và có phần đãng trí.', )
INSERT [dbo].[Campaign] ([Campaign_ID], [Organization_ID], [Name], [Target_budget], [Start_date], [End_date], [Status], [Description], [Image]) VALUES (5, 4, N'Cùng quyên góp hỗ trợ Má Phượng – Người phụ nữ suốt 20 năm ròng rã âm thầm làm từ thiện', 50000000.0000, CAST(N'2021-12-22' AS Date), NULL, 1, N'Cùng chung tay hỗ trợ cuộc sống cho má Phượng , giúp Má giảm bớt những gánh nặng, lo âu về cơm áo gạo tiền, cũng như mua bảo hiểm cho Má phòng lúc ốm đau bệnh tật.', )
INSERT [dbo].[Campaign] ([Campaign_ID], [Organization_ID], [Name], [Target_budget], [Start_date], [End_date], [Status], [Description], [Image]) VALUES (6, 3, N'Chung tay phục hồi mảng xanh, phủ xanh đất trống đồi trọc miền Trung, Quảng Trị', 150000000.0000, CAST(N'2021-12-21' AS Date), NULL, 1, N'Cùng Quỹ Hoa Chia Sẻ góp sức bảo vệ mảng xanh nhằm hạn chế biến đổi khí hậu và suy thoái môi trường, giảm thiểu thiên tai, hạn hán đối với các vùng đồng bào miền Trung nước ta.', )
INSERT [dbo].[Campaign] ([Campaign_ID], [Organization_ID], [Name], [Target_budget], [Start_date], [End_date], [Status], [Description], [Image]) VALUES (7, 3, N'Chung tay đóng góp để trồng cây bản địa và gây vườn rừng tại bản Cát Cát, Sapa', 100000000.0000, CAST(N'2021-12-20' AS Date), NULL, 1, N'Với mỗi 30,000 VNĐ, bạn có thể đóng góp để trồng một cái cây tại vườn rừng rộng 2ha tại bản Cát Cát - Sapa. Mục tiêu của chúng tôi là trồng 3000 cây để gây rừng, tạo công ăn việc làm cho người dân và phát triển thế mạnh cây bản địa của địa', )
INSERT [dbo].[Campaign] ([Campaign_ID], [Organization_ID], [Name], [Target_budget], [Start_date], [End_date], [Status], [Description], [Image]) VALUES (8, 5, N'Dự án Xanh Hà Nội trồng 500 cây xanh đô thị vì một Hà Nội không nóng bức', 100000000.0000, CAST(N'2021-12-19' AS Date), NULL, 1, N'Cùng chung tay trồng 500 cây xanh đô thị để tăng diện tích phủ xanh của thành phố để Hà Nội trở thành một nơi đáng sống cho tất cả mọi người', )
INSERT [dbo].[Campaign] ([Campaign_ID], [Organization_ID], [Name], [Target_budget], [Start_date], [End_date], [Status], [Description], [Image]) VALUES (9, 6, N'Chung tay hỗ trợ nghiên cứu và sản xuất cho phòng chống dịch bệnh', 100000000.0000, CAST(N'2021-12-18' AS Date), CAST(N'2021-12-30' AS Date), 1, N'Cùng chung tay nghiên cứu và phát triển công nghệ (sản xuất vắc xin, trang thiết bị chống dịch,...) để phục vụ phát triển kinh tế-xã hội và đặc biệt là phòng chống dịch trong thời điểm hiện nay.', )
INSERT [dbo].[Campaign] ([Campaign_ID], [Organization_ID], [Name], [Target_budget], [Start_date], [End_date], [Status], [Description], [Image]) VALUES (10, 6, N'Chung tay hỗ trợ cho tuyến đầu trực tiếp tham gia phòng chống dịch', 100000000.0000, CAST(N'2021-12-17' AS Date), CAST(N'2021-12-31' AS Date), 0, N'Cùng chia sẻ với những khó khăn, vất vả, hiểm nguy mà đội ngũ cán bộ, nhân viên ngành Y tế (y sỹ, bác sĩ, điều dưỡng, nhân viên y tế, lực lượng vũ trang, tổ phòng chống dịch ở cộng đồng...) đang căng mình trên tuyến đầu phòng, chống dịch.', )
INSERT [dbo].[Campaign] ([Campaign_ID], [Organization_ID], [Name], [Target_budget], [Start_date], [End_date], [Status], [Description], [Image]) VALUES (18, 1, N'Cùng chung tay xây Quỹ Học Bổng nuôi dưỡng giấc mơ giảng đường cho các em sinh viên nghèo', 100000000.0000, CAST(N'2022-01-08' AS Date), NULL, 1, N'“Nhà không đủ tiền cho con học tiếp” câu nói khiến bao nhân viên Thiện Chí chạnh lòng trong thời gian khảo sát học bổng.

Giáo dục chính là chìa khóa khai mở tự do và là cánh cửa hướng đến tương lai. Nhưng đối với nhiều em học sinh ở những vùng quê nghèo, xa xôi hẻo lánh thuộc huyện Đức Linh, Tánh Linh, Hàm Thuận Nam, tỉnh Bình Thuận, và huyện Ninh Sơn, Ninh Phước, tỉnh Ninh Thuận thì cánh cửa ấy có thể đóng lại bất cứ lúc nào. Đặc biệt trong tình hình dịch bệnh hiện nay, nhiều gia đình rơi vào cảnh tang thương, nhiều người mất việc không kiếm được thu nhập. Đối với các em sinh ra trong gia đình nghèo mà nói đã khó gấp đôi, dù trong lòng rất rất muốn cho con được tiếp tục bước chân vào Đại học nhưng cái lo toan chi tiêu trong việc học hành ngất ngưởng trong khoảng 3-4 năm dài lại làm họ chùn bước.  ', )
